import React, {useState, useEffect} from 'react';
import { Link } from 'react-router-dom'

function ListElement ({cur}) {

    const goToDetail = () => {
        console.log("handle go to detail");
        // go to detailed container page with item ID
    }

    const elemStyle={
        width: 300,
        height: 300,
        margin: 30,
        padding: 20,
        backgroundColor: 'white',
        cursor:"pointer",
        border:"1px white solid"
    }

    const imageStyle={
        width: 100,
        height:100
    }

    return (
        <div className="container"
            to="/getItem"
            style={elemStyle}>
            <Link 
                to='/getItem'
                style={{ 
                    textDecoration: 'none',
                    color:'black'
                }}>
            <h4>{cur.NAME}</h4>
            <img 
                src={cur.PICTURE}
                style={imageStyle}
            />
            <p>{cur.DETAIL.length>80? cur.DETAIL.slice(0,80)+'...' : cur.DETAIL}</p>
        </Link>
        </div>
    )
}
export default ListElement;
